sys_variable_value.value:
(function execute(inputs, outputs) {

    outputs.calculated_days = inputs.varWeek; 
    outputs.additional_days = inputs.varDay;
    outputs.total_days =   inputs.varWeek + inputs.varDay;
})(inputs, outputs);

